import React, { Component } from 'react'
import Main from "./components/Main"
export class App extends Component {
  state={
    expense:"0",
    earning:"0"
  }
  handleExpense=(e)=>{
    this.setState({
      thisexpense:e.target.value
    })
  }
  handleEarning=(e)=>{
    this.setState({
      earning:e.target.value
    })
  }
  render() {
    return (
      <div><center>
        <h1>Expense Tracker</h1>
        <Main handleEarning={this.handleEarning} handleExpense={this.handleEarning}/>
        </center></div>
    )
  }
}

export default App
